
<!doctype html>
<html lang="es">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>Kenny1TV — Enlaces</title>
<style>
:root{
  --bg:#050308;
  --panel:#0b0b10;
  --neon:#7cffdb;
  --accent:#8b5cf6;
  --glass: rgba(255,255,255,0.03);
  --glass-2: rgba(255,255,255,0.02);
}

/* Pixel-art tiled background made with SVG data URI */
body{
  margin:0;
  min-height:100vh;
  font-family: 'Press Start 2P', Arial, sans-serif;
  background-color: var(--bg);
  background-image: url("data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' width='64' height='64' viewBox='0 0 64 64'><rect width='64' height='64' fill='%23020308'/><g fill='%23060a0f'><rect x='0' y='0' width='4' height='4'/><rect x='12' y='12' width='4' height='4'/><rect x='24' y='24' width='4' height='4'/><rect x='36' y='36' width='4' height='4'/><rect x='48' y='48' width='4' height='4'/></g></svg>");
  background-repeat: repeat;
  display:flex;
  align-items:center;
  justify-content:center;
  padding:40px 20px;
  color:#e6f7ff;
}

/* container */
.container{
  width:100%;
  max-width:520px;
  text-align:center;
  background: linear-gradient(180deg, rgba(255,255,255,0.02), rgba(255,255,255,0.01));
  border-radius:18px;
  padding:28px;
  box-shadow: 0 8px 40px rgba(0,0,0,0.7), inset 0 1px 0 rgba(255,255,255,0.02);
  backdrop-filter: blur(6px);
  border: 1px solid rgba(140,92,246,0.08);
  position:relative;
  overflow:hidden;
}

/* subtle neon glow shapes */
.container::before{
  content:"";
  position:absolute;
  left:-20%;
  top:-30%;
  width:200%;
  height:160%;
  background: radial-gradient(600px 200px at 10% 10%, rgba(139,92,246,0.08), transparent 12%),
              radial-gradient(600px 200px at 90% 90%, rgba(124,255,219,0.06), transparent 12%);
  pointer-events:none;
}

/* header/logo */
.logo{ 
  width:160px;
  height:160px;
  margin:0 auto 10px;
  border-radius:20px;
  overflow:hidden;
  image-rendering: pixelated;
  box-shadow: 0 8px 30px rgba(124,255,219,0.06), 0 0 20px rgba(139,92,246,0.04) inset;
  border: 2px solid rgba(124,255,219,0.06);
  background: linear-gradient(180deg, rgba(255,255,255,0.02), rgba(255,255,255,0.01));
  display:flex;
  align-items:center;
  justify-content:center;
}

.logo img{
  max-width:92%;
  max-height:92%;
  display:block;
}

/* title */
h1{
  font-size:18px;
  margin:6px 0 18px;
  letter-spacing:1px;
  color:var(--neon);
  text-shadow: 0 0 8px rgba(124,255,219,0.2), 0 0 18px rgba(139,92,246,0.08);
}

/* links column */
.links{
  display:flex;
  flex-direction:column;
  gap:12px;
  padding:0 6px 6px;
}

/* neon pixel buttons */
a.linkbtn{
  display:flex;
  align-items:center;
  gap:12px;
  text-decoration:none;
  padding:14px 18px;
  border-radius:12px;
  background: linear-gradient(180deg, rgba(255,255,255,0.02), rgba(255,255,255,0.01));
  border:1px solid rgba(255,255,255,0.04);
  color:#eafdf7;
  font-weight:700;
  font-size:12.5px;
  letter-spacing:0.6px;
  box-shadow: 0 6px 18px rgba(0,0,0,0.6), 0 0 20px rgba(124,255,219,0.03) inset;
  transition: transform .12s ease, box-shadow .12s ease, filter .12s ease;
  position:relative;
  overflow:hidden;
  -webkit-backface-visibility: hidden;
}

/* icon pill */
.linkbtn .pill{
  min-width:36px;
  height:36px;
  display:inline-flex;
  align-items:center;
  justify-content:center;
  border-radius:8px;
  background: linear-gradient(180deg, rgba(255,255,255,0.02), rgba(255,255,255,0.01));
  border:1px solid rgba(255,255,255,0.03);
  font-weight:900;
  font-size:14px;
  filter: drop-shadow(0 2px 6px rgba(0,0,0,0.6));
  image-rendering: pixelated;
}

/* hover neon */
.linkbtn:hover{
  transform: translateY(-6px) scale(1.01);
  box-shadow: 0 18px 40px rgba(0,0,0,0.6), 0 0 30px rgba(124,255,219,0.12);
  filter: saturate(1.06);
}

.linkbtn::after{
  content:"";
  position:absolute;
  left:-30%;
  top:0;
  width:30%;
  height:100%;
  background: linear-gradient(90deg, rgba(124,255,219,0.06), rgba(139,92,246,0.06));
  transform: skewX(-18deg);
  transition: left .45s cubic-bezier(.2,.9,.2,1);
  pointer-events:none;
}

.linkbtn:hover::after{
  left:120%;
}

/* neon glow on focus for accessibility */
.linkbtn:focus{ outline: none; box-shadow: 0 0 0 3px rgba(124,255,219,0.06), 0 8px 30px rgba(139,92,246,0.06); }

/* small pixel border effect */
.pixel-edge{
  position:absolute;
  inset:0;
  border-radius:16px;
  pointer-events:none;
  background-image:
    linear-gradient(90deg, rgba(124,255,219,0.02) 1px, transparent 1px),
    linear-gradient(180deg, rgba(139,92,246,0.02) 1px, transparent 1px);
  background-size:8px 8px, 8px 8px;
  mix-blend-mode: screen;
  opacity:0.6;
}

/* responsive adjustments */
@media (max-width:480px){
  .container{ padding:20px; border-radius:14px; }
  .logo{ width:120px; height:120px; }
  h1{ font-size:13px; }
  .linkbtn{ padding:12px 14px; font-size:12px; }
}

/* pixel font import fallback (using system fonts if not available) */
@media (prefers-reduced-motion: no-preference) {
  .logo img{ transition: transform .9s ease-in-out; }
  .logo img:hover{ transform: rotate(-3deg) scale(1.02); }
}
</style>
</head>
